 import React,{useState} from 'react'
 import Navbar from '../components/NavBar';

const signin = () => {

    const [isOpen, setIsOpen] = useState(false);

    const toogle = ()=>{
        setIsOpen(!isOpen);
    }

    return (
        <div>
           <Navbar isOpen={isOpen} toogle={toogle}/>
            <h1>Crea tu cuenta</h1>
        </div>
    )
}

 export default signin;
